import "./Styles.css";

const Timebar = () => {
  let currentDate = new Date();
  let newDate;
  let week = [];
  for (var i = 0; i <= 7; i++) {
    newDate = new Date(
      currentDate.getFullYear(),
      currentDate.getMonth(),
      currentDate.getDate() + i
    );

    week.push({date:newDate.toDateString(),id:i});
  }
  return (
    <div className="flexbox">
      {week.map((day) => {
        return (
          <div key={day.id} className="dates">
            <h6>{day.date}</h6>
          </div>
        );
      })}
    </div>
  );
};

export default Timebar;
